import { render } from '@testing-library/react';

class App extends Component{
  constructor(props){
    super(props)
    this.state = {
      name:"Otávio"
    }

    this.changeState = this.changeState.bind(this)
  }



changeState(){
  this.setState({
    name:"Palloma Beatriz Biras"
  })
}

render(){
  return (
    <div className="App">
    <div>
    {this.state.name}
    </div>
      <button onClick={this.changeState}>Mudar Estado</button>
      <button onClick={this.changeState}>Resetar Estado</button>
    </div>

  );
  }
}
export default App;
